import React, { useState, useRef } from 'react';
import Header from './Header';
import { useNavigate } from 'react-router-dom';
import Post from './Post';

function Frontoffice() {


  const formParolaRef = useRef(null);
  const formAnnoRef = useRef(null);

  const [parolaDaCercare, setParolaDaCercare] = useState('');
  const [titoloPost, setTitoloPost] = useState('');
  const [dataCreazionePost, setDataCreazionePost] = useState('');
  const [pathImg, setPathImg] = useState('');
  const [descrizionePost, setDescrizionePost] = useState('');
  const [annoScelto, setAnnoScelto] = useState('2024');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  let list = [];

  const showCities = () => {

    citta.map((city) => (

      <Post key={city.id} title={city.name} imgURL={city.imgURL}>


        {city.description}

      </Post>


    ))
  }

  const citta = [

    {
      id: 0,
      name: "Trieste",
      imgURL: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRiDoPAzpD-c3vn68GSPlkcFor6yohEiKd6Tg&s",
      description: "Lorem ipsum dolorit sit amet",
    },
    {
      id: 1,
      name: "Trento",
      imgURL: "https://upload.wikimedia.org/wikipedia/commons/thumb/5/53/Sydney_Opera_House_and_Harbour_Bridge_Dusk_%282%29_2019-06-21.jpg/800px-Sydney_Opera_House_and_Harbour_Bridge_Dusk_%282%29_2019-06-21.jpg",
      description: "Lorem ipsum dolorit sit amet",
    },
    {
      id: 2,
      name: "Treviso",
      imgURL: "https://www.sftravel.com/sites/default/files/styles/hero/public/2022-10/painted-ladies-city-skyline-twilight.jpg.webp?itok=MVU3kPdc",
      description: "Lorem ipsum dolorit sit amet",
    }
  ];

  let resFilterReq;

  // const handleClick = () => {
  //   navigate('/login');
  // };


  // Funzione per eseguire la ricerca dei post
  const filterRequest = async (parolaDaCercare, annoScelto) => {
    try {
      // Effettua la richiesta GET al server
      const response = await fetch(
        `http://localhost:3000/api/filterRequest?ricercaParola=${parolaDaCercare}&ricercaAnno=${annoScelto}`,
        {
          method: 'GET',
          headers: { 'Content-Type': 'application/json' },
        }
      );

      // Converte la risposta in formato JSON
      const data = await response.json();


      if (response.status === 200) {

        data.result.forEach(post => {

          console.log('Id:', post.idPost, ', Titolo Post:', post.titoloPost);
        });
      } else {
        // Se non ci sono risultati, mostra un messaggio di errore
        setError(data.message);
      }
    } catch (error) {
      // Gestisce eventuali errori di rete o altri errori
      console.error('Errore durante il filtro:', error);
      setError('Errore del server.');
    }
  };


  const handleSubmit = async (e) => {
    e.preventDefault();

    const formId = e.target.id;

    if (formId === 'ricercaParola') {

      console.log('Form Parola inviato: ', annoScelto);
      filterRequest(parolaDaCercare, annoScelto);

    } else if (formId === 'ricercaAnno') {

      console.log('Form Anno inviato');
      filterRequest(parolaDaCercare, annoScelto);

    }
  };

  return (
    <>
      <Header />

      <div className="introBlog">
        <div>
          <h2>Ciao, benvenuto nel mio blog personale, spero ti piaccia</h2>
          <button type="button" /*onClick={handleClick}*/>
            LOGIN
          </button>
        </div>

        <div className="introduzioneMioBlog">
          <p>
            Ciao, benvenuto nel mio blog personale, mi presento: mi chiamo Matteo Kalcich, ho 18 anni e
            studio informatica. Una cosa che mi piace fare durante il tempo libero Ã¨ programmare per conto mio
            approfondendo aspetti di mio interesse.
          </p>
        </div>

        <div className="centroPagina">

          <form ref={formParolaRef} onSubmit={handleSubmit} className="ricerca" id="ricercaParola">
            <p id="ricerca">RICERCA</p>
            <input
              type="text"
              name="parolaDaCercare"
              id="parolaDaCercare"
              onChange={(e) => setParolaDaCercare(e.target.value)}
              value={parolaDaCercare}
            />
            <button type="submit" name="cerca" id="cercaBtn">
              CERCA
            </button>
          </form>


          <form ref={formAnnoRef} onSubmit={handleSubmit} className="filtraAnno" id="ricercaAnno">
            <button type="submit" name="primoPost" className="allDivFiltraAnno firstLastBtn">
              <p>PRIMO</p>
            </button>

            <button type="submit" name="precedenteAnnoPost" className="allDivFiltraAnno afterFirstBeforeLastBtn">
              <p>Precedente</p>
            </button>

            <div className="allDivFiltraAnno annoCorrente">
              <p>Anno Scelto: {annoScelto}</p>
            </div>

            <button type="submit" name="successivoAnnoPost" className="allDivFiltraAnno afterFirstBeforeLastBtn">
              <p>Successivo</p>
            </button>

            <button type="submit" name="ultimoPost" className="allDivFiltraAnno firstLastBtn">
              <p>ULTIMO</p>
            </button>
          </form>

          <div className="post">

            <h1>Ecoot utto il contenuto di test</h1>


            {citta.map((city) => (

              <Post key={city.id} titolo={city.name} imgSrc={city.imgURL} descrizione={city.description} />


            ))}



          </div>
        </div>
      </div>
    </>
  );
}

export default Frontoffice;
